import { ADD_LIST, CHANGE_LIST_NUM } from './action-type'
export default {
    addList() {
        let action = {
            type: ADD_LIST
        }
        return action
    },
    changeNum() {
        return {
            type: CHANGE_LIST_NUM
        }
    }
}
